import React, { useState, useEffect } from 'react';
import { MapContainer, TileLayer, GeoJSON } from 'react-leaflet';
import axios from 'axios';
import DatePicker from './DatePicker';
import 'leaflet/dist/leaflet.css';
import './styles.css';

const MapComponent = () => {
    const [mapData, setMapData] = useState(null);
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState(null);

    const layerStyles = {
        baseline: {
            color: '#ff0000',
            weight: 2,
            fillOpacity: 0
        },
        current: {
            color: '#0000ff',
            weight: 2,
            fillOpacity: 0
        },
        erosion: {
            color: '#ff0000',
            weight: 3,
            dashArray: '5,5',
            fillColor: '#ff0000',
            fillOpacity: 0.3
        },
        accretion: {
            color: '#00ff00',
            weight: 3,
            dashArray: '5,5',
            fillColor: '#00ff00',
            fillOpacity: 0.3
        }
    };

    const handleAnalyze = async (endDate) => {
        setLoading(true);
        setError(null);
        try {
            const response = await axios.post('http://localhost:5000/get-map-data', {
                end_date: endDate
            });

            setMapData({
                baseline: response.data.baseline,
                current: response.data.current,
                erosion: response.data.erosion,
                accretion: response.data.accretion
            });

        } catch (error) {
            setError(error.response?.data?.error || "Analysis failed");
        } finally {
            setLoading(false);
        }
    };

    const renderFeatures = (data, style) => {
        if (!data) return null;
        return <GeoJSON data={data} style={style} />;
    };

    return (
        <div className="map-container">
            <MapContainer
                center={[46.5107, -63.4168]}
                zoom={10}
                style={{ height: '100vh', width: '100%' }}
            >
                <TileLayer
                    url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                    attribution='&copy; OpenStreetMap contributors'
                />

                {mapData?.baseline && renderFeatures(mapData.baseline, layerStyles.baseline)}
                {mapData?.current && renderFeatures(mapData.current, layerStyles.current)}
                {mapData?.erosion && renderFeatures(mapData.erosion, layerStyles.erosion)}
                {mapData?.accretion && renderFeatures(mapData.accretion, layerStyles.accretion)}

                <div className="legend">
                    <h4>Legend</h4>
                    <div className="legend-item">
                        <div style={{ backgroundColor: '#ff0000' }} />
                        <span>2000 Baseline</span>
                    </div>
                    <div className="legend-item">
                        <div style={{ backgroundColor: '#0000ff' }} />
                        <span>Current Coastline</span>
                    </div>
                    <div className="legend-item">
                        <div style={{ backgroundColor: '#ff0000' }} />
                        <span>Erosion Areas</span>
                    </div>
                    <div className="legend-item">
                        <div style={{ backgroundColor: '#00ff00' }} />
                        <span>Accretion Areas</span>
                    </div>
                </div>
            </MapContainer>

            <div className="controls">
                <DatePicker onAnalyze={handleAnalyze} />
                {loading && <div className="loading">Processing...</div>}
                {error && <div className="error">{error}</div>}
            </div>
        </div>
    );
};

export default MapComponent;
